import { Routes, Route } from 'react-router-dom';

function Home() {
  return <h2>Home</h2>;
}



function App() {
  return (
    <div className="App">
      <h1>Hello React Router v6</h1>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  );
}

export default App;
